export const makeNewAccount = async (req, res, next) => {
  const { name, id, pw } = req.body;
  let response = {
    ok: null,
    error: null
  };

  try {
    const existingUser = await User.findOne({ id });
    if (existingUser) {
      response = {
        ok: false,
        error: '이미 존재하는 아이디입니다. '
      };
    } else {
      const newuser = await User.create({
        name,
        id,
        pw
      });
      await newuser.save();
      response = {
        ok: true,
        error: null
      };
    }
  } catch (err) {
    response = {
      ok: false,
      error: err.message
    };
  }

  res.json(response);
};

